import React from 'react';
import ReactDOM from 'react-dom';
import Home from './home';
const text = "back";

class Balance extends React.Component {

  back = () => {

    ReactDOM.render(<Home />, document.getElementById('global'));

  }

  foo = () => {

    var info = this.props.info_person;

    var obj = [];

    info.map(function(elem) {
      obj.unshift(elem.innerHTML);
    });

    console.log(obj);
  //  return info[2].innerHTML;


  }

  render () {

    return (
          <div>
            <p>balanse</p>
             {this.foo()}
             <button onClick={this.back} id="button_back">{text}</button>

         </div>
    );

  }

}
export default Balance;
